function hideAd(){
    //右侧广告
    $('#content_right').hide();
    //过滤第一页第一条正常信息和多页之后的最后两条广告
    $('[id=1]').each(function(){
        if($(this).hasClass('new-pmd') || $(this).hasClass('result-op')){
           return;
        }else{
            $(this).hide();
        }
        });
    $('[id]').each(function(){ if($(this).attr('id').substring(1,3) == '00'){$(this).hide();} })
}
